import violin from '../../assets/violin.jpg';
import trombone from '../../assets/trombone.jpg';
import './HomePageSecond.css';

function GetAllCollapsibles()
{
    return document.getElementsByClassName("home-page-second-card");
}

function SetCollapsibleListeners()
{
    for (var collapsible of GetAllCollapsibles())
